import React from 'react';

const TweetCard = ({ text, author }) => {
  return (
    <div className="card tweet-card">
      <p style={{ color: '#aaa', fontSize: '12px' }}>{author}</p>
      <p>{text}</p>
    </div>
  );
};

export default TweetCard;
